    public static int removeDuplicates(int[] nums) {
        int i = 2,j = 2;
        for ( ; j < nums.length; j++) {
            while (i < nums.length && nums[i] != nums[i-2]) {
                i++;
            }
            while (j < nums.length && nums[j] == nums[j-2]) {
                j++;
            }
            if (j < nums.length && i <= j) {
                nums[i] = nums[j];
                i++;
            }
        }
        return i;
    }

    public static void main(String[] args) {
        int[] nums = new int[]{1,1,1,2,3};
        int ret = removeDuplicates(nums);
        for (int i = 0; i < nums.length; i++) {
            System.out.println(nums[i]);
        }
        System.out.println(nums);
    }

    public static String addBinary(String a, String b) {
        StringBuilder str = new StringBuilder("");
        int lena = a.length();
        int lenb = b.length();
        int dig = 0;
        while (lena > 0 || lenb > 0) {
            int tmpa = 0, tmpb = 0;
            if (lena > 0 && lenb > 0) {
                tmpa = a.charAt(lena-1)-'0';
                tmpb = b.charAt(lenb-1)-'0';
            } else if (lena <= 0 && lenb > 0) {
                tmpb = b.charAt(lenb-1)-'0';
            } else {
                tmpa = a.charAt(lena-1)-'0';
            }
            int count = (tmpa+tmpb+dig) % 2;
            dig = (int)(tmpa+tmpb+dig)/2;
            str.append(count);
            lena--;
            lenb--;
        }
        while (dig > 0) {
            str.append(dig%2);
            dig /= 2;
        }
        String ret = str.reverse().toString();
        return ret;
    }

    public static void main10(String[] args) {
        String tmp = addBinary("11", "1");
        System.out.println(tmp);
    }

    public static int getMinimumDifference(TreeNode root) {
        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(root);
        int min = root.val;
        int minLast = min;
        while (!queue.isEmpty()) {
            TreeNode tmp = queue.poll();
            if (tmp != null) {
                if (tmp.val < min) {
                    minLast = min;
                    min = tmp.val;
                }
                if (minLast <= min || (tmp.val < minLast && tmp.val > min)) {
                    minLast = tmp.val;
                }
                queue.offer(tmp.left);
                queue.offer(tmp.right);
            }
        }
        return Math.abs(minLast-min);
    }

