    public static List<Double> averageOfLevels(TreeNode root) {
        List<Double> list = new ArrayList<>();
        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(root);
        while (!queue.isEmpty()) {
            int size = queue.size(), sizeCount = size;
            Double d = 0.0;
            boolean flg = false;
            while (size > 0) {
                TreeNode tmp = queue.poll();
                if (tmp != null) {
                    d += tmp.val;
                    queue.offer(tmp.left);
                    queue.offer(tmp.right);
                    flg = true;
                } else {
                    sizeCount--;
                }
                size--;
            }
            if (flg == true) {
                list.add(d/sizeCount);
            }
        }
        return list;
    }

