    public static int[] plusOne(int[] digits) {
        int len = digits.length;
        int dig = 0, count = 0;
        while (len > 0) {
            count = digits[len-1]+dig;
            if (len == digits.length) {
                count += 1;
            }
            dig = count / 10;
            digits[len-1] = count % 10;
            len--;
        }
        if (dig == 0) {
            return digits;
        }
        len = digits.length;
        int[] ret = new int[len+1];
        ret[0] = dig;
        for (int i = 1; i <= len; i++) {
            ret[i] = digits[i-1];
        }
        return ret;
    }

